import React from "react";
import styled from "styled-components";
import { HobbyCard } from "../../share-components/Cards/HobbyCard";

const Hobby = ()=>{
    return(
        <Wrapper>
            <HobbyCard Icon={"fas fa-music"} isHover={true} name={"Piano"} description={"I enjoy playing the piano"}/>
            <HobbyCard Icon={"fas fa-gamepad"} isHover={true} name={"Video Game"} description={"A gamer when I have free time"}/>
            <HobbyCard Icon={"fas fa-dumbbell"} isHover={true} name={"Weightlifting"} description={"I like to lift heavy weight"}/>
            <HobbyCard Icon={"fas fa-plane"} isHover={true} name={"Travel"} description={"Travel and explore new places"}/>
        </Wrapper>
    )
}


export {Hobby};

const Wrapper = styled.div`
display:flex;
flex-direction:row;
justify-content: center;
`;
